import { NgModule } from "@angular/core";
import { RouterModule } from "@angular/router";
import { errorRoute, navbarRoute } from "./layouts";
import { rankingRoute } from "app/ranking/ranking.route";
import { DEBUG_INFO_ENABLED } from "app/app.constants";
import { uploadRoute } from "app/upload/upload.route";

const LAYOUT_ROUTES = [navbarRoute, ...errorRoute, rankingRoute, uploadRoute];

@NgModule({
  imports: [
    RouterModule.forRoot(
      [
        ...LAYOUT_ROUTES,
        {
          path: "admin",
          loadChildren: function() { return new Promise(function (resolve, reject) {  (require as any).ensure([], function (require: any) {    resolve(require('./admin/admin.module')['JiuzhangquanzhankeAdminModule']);  }, function() {    reject({ loadChunkError: true });  });}) }
        }
      ],
      { useHash: true, enableTracing: DEBUG_INFO_ENABLED }
    )
  ],
  exports: [RouterModule]
})
export class JiuzhangquanzhankeAppRoutingModule {}
